import React from 'react';
import Header from './Header.jsx';
import Footer from './Footer.jsx';
import CreateNotes from './CreateNotes.jsx';
import Note from './Note.jsx';
const App = ()=>{

    const addNote = (note)=>{
        alert("I am Clicked");
    };
    return(
        <>
        <Header/>
        <Footer/>
        <CreateNotes passNote={addNote}/>
        <Note/>
        </>
    );
}

export default App;
